INSERT INTO `folders` VALUES (1,2,'dfb02b2d-fd26-3985-b0d8-b7ca627dd992','tudiant','2021','Universit dAbomey-Calavi','Agrobusiness','Sans activit professionnelle','Intermdiaire','Je voudrais suivre la formation afin de me perfectionner dans le domaine du codage.','Avoir une bonne base du langage HTML et CSS','Dans 3ans, je vise aider des dizaines dentreprises dans le domaine de dveloppement de code','Le mtier de dveloppeur codeur est un mtier prometteur car c\'est un mtier de plus en plus transversal : tlvision, transports, art, mdias, sciences, le codeur est partout. Une pierre angulaire des entreprises modernes.','Par un ami',NULL,NULL),(2,3,'50069b43-10bf-3271-a025-449283e8e2ea','tudiant','2019','LyTA/BSAA','DEAT','Sans activit professionnelle','Dbutant','J\'aimerais suivre cette formation afin de mettre fin au chmage','Garantie d\'un avenir meilleur','En ralit tout a dpend','A vrai dire a me donne beaucoup d\'ides mais je ne sais de quoi cela peut tre vraiment.','Par un ami',NULL,NULL),(3,4,'df3b4f85-4dc6-36a7-84c7-c87edf26bbb6','tudiant','2022','cole Suprieure dAdministration, d\'Economie, de Journalisme et des Mtiers de l\'audiovisuel','Administration gnrale territoriale','tudiant','Dbutant','Je suis un jeune tudiant jai fais ma soutenance en administration gnrale territoriale. Je ne cache pas que jai perdu du temps mais je suis jeune et je pense que jai le temps . Depuis tout petit en regardant la tlvision jai vu ce qutait capable de faire un informaticien un codeur pour ainsi dire ,petit  petit cest devenu un rve. Crer des logiciels cest mon rve. Crer un Logiciel capable de rvolutionner le monde cest  ce que jai envie de faire , or le codage est le seul moyen dy arriver je nai pas eu lopportunit de faire ce que je voulais  luniversit. mais jai lintime conviction que si vous me laissez y participer je vais me surpasser , me battre devenir le meilleur et raliser mon rve.','Mes attentes par rapport a cette formation \r\nApprendre tout dabord , avoir de lexprien